import React, { Component } from 'react';
import Blayout from './blayout/Blayout'
import Media from './media/Media'
import './App.css';

class App extends Component {
  constructor(){
  super()

}
  render() {
    return (
      <div>
        <Blayout 
        items = {[
          {value: 'BarberShop', id: 0},
          {value: 'ParloSalon', id: 1},
          {value: 'TattoParlo', id: 2},


          ]}

        />
        <Media />
      </div>
    );
  }
}

export default App;
